import React from "react";
import PropTypes from "prop-types";

const DisplayFont = ({ fileName }) => {
  return (
    <div>
      <p>{fontName}</p>
    </div>
  );
};

DisplayFont.propTypes = {
  fontName: PropTypes.string.isRequired
};

export default DisplayFont;
